import React, { useState } from 'react';

const Header = () => {
    const [isMenuOpen, setIsMenuOpen] = useState(false);

    const toggleMenu = () => {
        setIsMenuOpen(!isMenuOpen);
    };

    const headerStyle = {
        background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
        padding: '1rem 0',
        boxShadow: '0 4px 20px rgba(0, 0, 0, 0.1)',
        position: 'sticky',
        top: 0,
        zIndex: 1000,
        transition: 'all 0.3s ease'
    };

    const containerStyle = {
        maxWidth: '1200px',
        margin: '0 auto',
        padding: '0 2rem',
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center'
    };

    const logoStyle = {
        fontSize: '2rem',
        fontWeight: 'bold',
        color: '#ffffff',
        textDecoration: 'none',
        background: 'linear-gradient(45deg, #ff6b6b, #4ecdc4)',
        WebkitBackgroundClip: 'text',
        WebkitTextFillColor: 'transparent',
        backgroundClip: 'text',
        textShadow: '2px 2px 4px rgba(0,0,0,0.3)'
    };

    const navStyle = {
        display: 'flex',
        listStyle: 'none',
        margin: 0,
        padding: 0,
        gap: '2rem',
        alignItems: 'center'
    };

    const navItemStyle = {
        color: '#ffffff',
        textDecoration: 'none',
        fontSize: '1.1rem',
        fontWeight: '500',
        padding: '0.5rem 1rem',
        borderRadius: '8px',
        transition: 'all 0.3s ease',
        position: 'relative',
        overflow: 'hidden'
    };

    const mobileMenuStyle = {
        display: 'none',
        flexDirection: 'column',
        background: 'rgba(255, 255, 255, 0.1)',
        backdropFilter: 'blur(10px)',
        position: 'absolute',
        top: '100%',
        left: 0,
        right: 0,
        padding: '1rem',
        gap: '0.5rem',
        transform: isMenuOpen ? 'translateY(0)' : 'translateY(-100%)',
        opacity: isMenuOpen ? 1 : 0,
        transition: 'all 0.3s ease'
    };

    const hamburgerStyle = {
        display: 'none',
        flexDirection: 'column',
        cursor: 'pointer',
        padding: '0.5rem',
        gap: '4px'
    };

    const hamburgerLineStyle = {
        width: '25px',
        height: '3px',
        backgroundColor: '#ffffff',
        borderRadius: '2px',
        transition: 'all 0.3s ease'
    };

    const ctaButtonStyle = {
        background: 'linear-gradient(45deg, #ff6b6b, #ee5a24)',
        color: '#ffffff',
        padding: '0.75rem 1.5rem',
        borderRadius: '25px',
        textDecoration: 'none',
        fontWeight: 'bold',
        fontSize: '1rem',
        border: 'none',
        cursor: 'pointer',
        transition: 'all 0.3s ease',
        boxShadow: '0 4px 15px rgba(255, 107, 107, 0.3)'
    };

    return (
        <header style={headerStyle}>
            <div style={containerStyle}>
                <a href="/" style={logoStyle}>
                    ✨ Healthcare Pro
                </a>
                
                <nav style={{position: 'relative'}}>
                    <ul style={{...navStyle, '@media (max-width: 768px)': {display: 'none'}}}>
                        <li>
                            <a 
                                href="/" 
                                style={navItemStyle}
                                onMouseEnter={(e) => {
                                    e.target.style.background = 'rgba(255, 255, 255, 0.2)';
                                    e.target.style.transform = 'translateY(-2px)';
                                }}
                                onMouseLeave={(e) => {
                                    e.target.style.background = 'transparent';
                                    e.target.style.transform = 'translateY(0)';
                                }}
                            >
                                🏠 Home
                            </a>
                        </li>
                        <li>
                            <a 
                                href="/doctors" 
                                style={navItemStyle}
                                onMouseEnter={(e) => {
                                    e.target.style.background = 'rgba(255, 255, 255, 0.2)';
                                    e.target.style.transform = 'translateY(-2px)';
                                }}
                                onMouseLeave={(e) => {
                                    e.target.style.background = 'transparent';
                                    e.target.style.transform = 'translateY(0)';
                                }}
                            >
                                👨‍⚕️ Doctors
                            </a>
                        </li>
                        <li>
                            <a 
                                href="/patients" 
                                style={navItemStyle}
                                onMouseEnter={(e) => {
                                    e.target.style.background = 'rgba(255, 255, 255, 0.2)';
                                    e.target.style.transform = 'translateY(-2px)';
                                }}
                                onMouseLeave={(e) => {
                                    e.target.style.background = 'transparent';
                                    e.target.style.transform = 'translateY(0)';
                                }}
                            >
                                🏥 Patients
                            </a>
                        </li>
                        <li>
                            <a 
                                href="/appointments" 
                                style={navItemStyle}
                                onMouseEnter={(e) => {
                                    e.target.style.background = 'rgba(255, 255, 255, 0.2)';
                                    e.target.style.transform = 'translateY(-2px)';
                                }}
                                onMouseLeave={(e) => {
                                    e.target.style.background = 'transparent';
                                    e.target.style.transform = 'translateY(0)';
                                }}
                            >
                                📅 Appointments
                            </a>
                        </li>
                    </ul>

                    <div 
                        style={hamburgerStyle} 
                        onClick={toggleMenu}
                        className="mobile-menu-toggle"
                    >
                        <span style={hamburgerLineStyle}></span>
                        <span style={hamburgerLineStyle}></span>
                        <span style={hamburgerLineStyle}></span>
                    </div>

                    <div style={mobileMenuStyle} className="mobile-menu">
                        <a href="/" style={{...navItemStyle, display: 'block'}}>🏠 Home</a>
                        <a href="/doctors" style={{...navItemStyle, display: 'block'}}>👨‍⚕️ Doctors</a>
                        <a href="/patients" style={{...navItemStyle, display: 'block'}}>🏥 Patients</a>
                        <a href="/appointments" style={{...navItemStyle, display: 'block'}}>📅 Appointments</a>
                    </div>
                </nav>

                <button 
                    style={ctaButtonStyle}
                    onMouseEnter={(e) => {
                        e.target.style.transform = 'translateY(-2px) scale(1.05)';
                        e.target.style.boxShadow = '0 8px 25px rgba(255, 107, 107, 0.4)';
                    }}
                    onMouseLeave={(e) => {
                        e.target.style.transform = 'translateY(0) scale(1)';
                        e.target.style.boxShadow = '0 4px 15px rgba(255, 107, 107, 0.3)';
                    }}
                >
                    📞 Contact Us
                </button>
            </div>

            <style jsx>{`
                @media (max-width: 768px) {
                    .mobile-menu-toggle {
                        display: flex !important;
                    }
                    nav ul {
                        display: none !important;
                    }
                    .mobile-menu {
                        display: ${isMenuOpen ? 'flex' : 'none'} !important;
                    }
                }
            `}</style>
        </header>
    );
};

export default Header;
